import pytest
import numpy as np
from icicle_playgrounds.pydantic_models.plug_n_play import Image


@pytest.fixture
def rgb_image_array():
    return np.random.randint(0, 255, size=(100, 100, 3), dtype=np.uint8)

@pytest.fixture
def grayscale_image_array():
    return np.random.randint(0, 255, size=(100, 100), dtype=np.uint8)

@pytest.fixture
def rgb_image_url():
    return "https://raw.githubusercontent.com/tapis-project/camera-traps/refs/heads/main/installer/example_images/baby-red-fox.jpg"

@pytest.fixture
def rgb_image_base64():
    return ""


class TestImageSchema:
    def test_build_from_numpy_rgb(self, rgb_image_array):
        image = Image(
            image=rgb_image_array
        )
        assert isinstance(image, Image)
        assert np.array_equal(image.image, rgb_image_array)

    def test_build_from_numpy_grayscale(self, grayscale_image_array):
        image = Image(
            image=grayscale_image_array
        )
        assert isinstance(image, Image)
        assert np.array_equal(image.image, grayscale_image_array)

    def test_build_from_rgb_base64(self, rgb_image_base64):
        image = Image(
            image=rgb_image_base64
        )
        assert isinstance(image, Image)

    def test_build_from_rgb_image_url(self, rgb_image_url):
        image = Image(
            image=rgb_image_url
        )
        assert isinstance(image, Image)

    def test_model_dump_from_rgb_image_url(self, rgb_image_url):
        image = Image(
                image=rgb_image_url
            )
        assert isinstance(image.model_dump(), dict)